const URL_API = 'http://localhost:3002'

axios.defaults.baseURL = URL_API

export const ProductApi  = {
    async getKFC(){
        const app = await axios.get('/KFC')
       return app
    },

    async getPizzaDay(){
        const app = await axios.get('/PizzaDay')
       return app
    },

    async getIQpizza(){
        const app = await axios.get('/KFC')
       return app
    },




}
